"use strict";

module.exports = function (h, s, l, a) {
  return a != null ? "hsla" + "(" + h + "," + s + "%" + "," + l + "%" + "," + a + ")" : "hsl" + "(" + h + "," + s + "%" + "," + l + "%" + ")";
};
